import React from 'react';
import { useNavigate } from "react-router-dom";
import "../styles/Menu.css";

function Menu({title}) {
  const useNavigate = useNavigate();
  return (
    <div className='menu'>
        <div className='menu-title' onClick={() => useNavigate(`/${title}`)}>
            {title}
        </div>
        
    </div>
  )
}

export default Menu
